import React from 'react';

function InputComponent({ title }) {
  return (
    <div>
      <form>
        <label>Enter new title:
          <input
            type="text"
            value={inputText}
            onChange={handleInputChange}
          />
        </label>
      </form>
    </div>
  );
}

export default InputComponent;
